import React from "react";
import { useParams } from "react-router-dom";

const SongDetails = () => {
  // Använd useParams för att extrahera ID:et från URL:en
  const { id } = useParams();

  // Hämta sånginformation baserat på ID:et
  // Här ersätter du troligtvis med ett anrop till ditt API eller ett statiskt dataset
  let songData;

  if (id === "1") {
    songData = { title: "Song 1", artist: "Artist 1" };
  } else if (id === "2") {
    songData = { title: "Song 2", artist: "Artist 2" };
  } else {
    // Hantera om id inte matchar någon känd sång
    songData = { title: "Unknown Song", artist: "Unknown Artist" };
  }

  // Visa den relevanta sånginformationen
  return (
    <div>
      <h2>Song Details</h2>
      <p>Title: {songData.title}</p>
      <p>Artist: {songData.artist}</p>
    </div>
  );
};

export default Song;
